import styled from 'styled-components';


export const FooterStyle = styled.footer`


    position: fixed;
    bottom: 0;
    width: 100%;
    height: 4rem;
    align-items: center;
    justify-content: space-between;



`

export const ContactItem = styled.span`
     margin-left: 2rem;
    p, a{
        display: inline; 
        font-size: 20px;
        margin-left: 0.4rem;

    }

    a:hover {
        color: rgb(226, 167, 254);
    }   
`
